import React from "react";
import { useAppSelector } from "../hooks";
import { Menubar } from "primereact/menubar";
import styled from "styled-components";
import { CELSIUS, FAHRENHEIT, KELVIN } from "../common/constants";

const StyledTopBar = styled(Menubar)`
  width: 100%;
`;

export const TopBar = () => {
  const locationName = useAppSelector((state) => state.weather.locationName);
  const units = useAppSelector((state) => state.weather.units);

  console.log(units);

  const items = [
    {
      label: `Location: ${locationName}`,
    },
    {
      label: "Units",
      items: [
        { label: KELVIN, icon: "pi pi-check" },
        { label: FAHRENHEIT, icon: "pi pi-check" },
        { label: CELSIUS, icon: "pi pi-check" },
      ],
    },
  ];

  return <StyledTopBar model={items} />;
};
